import React from 'react';
import './App.css';

function App() {
  return (
    <div className="root-view">
      <div className="rm-toolbar"></div>
      <div className="main-view">
        <div className="sidebar"></div>
          <div className="scrollable-area"></div>
        <div className="rm-list"></div>
      </div>
    </div>
  );
}

export default App;
